import React from 'react'

const PaginaCategorias = ({lista}) => {
    return (
        <>
            <ul>
                {lista.map(item => {
                    <li key={item.id}>
                        {item.descricao}
                    </li>
                })}
            </ul>
        </>
    )
}

export default PaginaCategorias
